import React from "react";
import { Box, FormControl, InputLabel, Input, FormHelperText, TextField, Container, CssBaseline } from '@mui/material';

const ContactForm = () => {
    return(
        <>
        <Container maxWidth="sm">
        <CssBaseline />  
        <Box
         display="flex"
         flexDirection={"column"}
         maxWidth={400}
         alignItems="center"
         justifyContent={"center"}
         margin="auto"
         marginTop={5}
         padding={3}
        borderRadius={5}
        boxShadow={"5px 5px 10px #000000"}
        >
        <h2>Contact</h2>
            <TextField
            margin="normal"
            required
            /*helperText="Please enter your name"*/
            id="name"
            label="Full Name"
            autoFocus
            />
        <TextField
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              autoFocus
              /*value={email}
        onChange={(e) => setEmail(e.target.value)}*/
            />
            <TextField
            margin="normal"
            required
            fullWidth
            id="message"
            label="Message"
            placeholder="message"
            multiline
            />
        </Box>

        </Container>
        </>
    );
}

export default ContactForm;
